import React from 'react';
import { Router } from "react-router-dom";
import { createBrowserHistory } from 'history';
import Routes from './Routes';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Router history>
          <Routes />
        </Router>
      </div>
    );
  }
}

export default App;
